import React from 'react';
import Sdata from './Sdata';
import Card from './Card';


const Netflix = () => {
    return(
        // <Card 
        // key={Sdata[2].id}
        // sname={Sdata[2].sname}
        // imgsrc={Sdata[2].imgsrc}
        // title={Sdata[2].title}
        // link={Sdata[2].links}
        // />
        Sdata.map((val) =>{
            return(
                <Card 
                key={val.id}
                sname={val.sname}
                imgsrc={val.imgsrc}
                title={val.title}
                link={val.links}
                />
            );
        }).filter((elem) => {
            return(
                elem.title == 'Netflix Original Series'
            );
        })
    );
}


export default Netflix;
